#include "../include/header.h"


/*
Given a 2D board containing 'X' and 'O' (the letter O), capture all regions surrounded by 'X'.

A region is captured by flipping all 'O's into 'X's in that surrounded region.

For example,
X X X X
X O O X
X X O X
X O X X
After running your function, the board should be:

X X X X
X X X X
X X X X
X O X X
*/

class Solution {
public:

    void dfs(int x, int y, int dx[], int dy[], int row, int col, \
                vector<vector<char> >&board, vector<vector<bool> >& vis, deque<pair<int, int> >& q, bool& flag)
    {
        if(0 == x || row - 1 == x || 0 == y || col - 1 == y)
        {
            flag = true;
        }

        for(int i = 0; i < 3; ++i)
        {
            int nx = x + dx[i];
            int ny = y + dy[i];
            if(0 <= nx && row > nx && 0 <= ny && col > ny && 'O' == board[nx][ny] && !vis[nx][ny])
            {
                vis[nx][ny] = true;
                q.push_back(make_pair(nx, ny));
                dfs(nx, ny, dx, dy, row, col, board, vis, q, flag);
            }
        }
    }

    void solve(vector<vector<char> >& board) {
        int row = board.size();
        if(0 == row)
        {
            return;
        }
        int col = board[0].size();
        if(0 == col)
        {
            return;
        }

        int dx[] = {0, 1, 0, -1};
        int dy[] = {1, 0, -1, 0};
        vector<vector<bool> > vis(row, vector<bool>(col, false));
        for(int i = 0; i < row; ++i)
        {
            for(int j = 0; j < col; ++j)
            {
                if('O' == board[i][j] && !vis[i][j])
                {
                    deque<pair<int, int> > q;
                    q.push_back(make_pair(i, j));
                    bool flag = false; /* false: need to change */
                    dfs(i, j, dx, dy, row, col, board, vis, q, flag);
                    if(!flag) /* Set the queue */
                    {
                        while(!q.empty())
                        {
                            pair<int, int> coordinate = q.front();
                            q.pop_front();
                            board[coordinate.first][coordinate.second] = 'X';
                        }
                    }
                }
                //vis[i][j] = true;
            }
        }
    }
};

